anders eriksson < aeriksson @ fastmail.fm > cwg-dated-1027805573.3ce2ae @ deepeddy.com said : > checked code cleanup n't address issue , > take machete code right around . ought 'cvs > update ' see issue becomes clearer > brush removed . > patch notes 'msgid ' 'line ' redundant one > another removes one functions takes > . callers changed pass function > expects . case msg_change , 'line ' argument removed > msgid argument . ftoc_clearcurrent > first line msgchange . following patch removes ftoc_rescanline favour ftoc_rescanlines . runs scan ( 1 ) list lines updates ftoc accordingly . patch also changes callers make use . also changes ftoc_clearcurrent work argument instead falsily clearing message 's still current disk . effort get one-to-one disk-display correspondence . add ~30 -- ~ 75 ms ( ~ < 10 % ) execution time depending folder size due invocation scan . however version try second guess mh version scan exotic scanlines tells truth . side effect '+ ' sign corresponds better 's disk . comments appreciated . 'm going offlike couple days , send cvs diff rather putting cvs . /anders index : lib/ftoc.tcl =================================================================== rcs file : /cvsroot/exmh/exmh/lib/ftoc.tcl , v retrieving revision 1.29 diff -u -b -b -w -p -r1.29 ftoc.tcl -- - lib/ftoc.tcl 22 jul 2002 21:46:35 -0000 1.29 +++ lib/ftoc.tcl 24 jul 2002 09:16:25 -0000 @ @ -558,7 +558,7 @ @ proc ftocpickrange { { addcurrent 0 } } { { $ addcurrent } { ftoc_rangehighlight $ ftoc ( curline ) $ ftoc ( curline ) } - ftoc_clearcurrent + ftoc_clearcurrent $ ftoc ( curline ) msg_clearcurrent set ftoc ( curline ) { } } @ @ -611,31 +611,55 @ @ proc ftoc_newftoc { } { # ftoc_clearcurrent ftoc_change two parts # dinking ftoc display advancing message . -proc ftoc_clearcurrent { } { - # clear display current message + # + # make line longer appear currently selected line + # + +proc ftoc_clearcurrent { line } { global ftoc exwin set ftoc ( pickone ) 1 set ftoc ( lineset ) { } - { $ ftoc ( curline ) == { } } { - set ftoc ( curline ) [ mh_cur $ ftoc ( folder ) ] - } - { $ ftoc ( curline ) ! = { } } { - $ exwin ( ftext ) tag remove cur $ ftoc ( curline ) .0 $ ftoc ( curline ) .end - ftoc_rescanline $ ftoc ( curline ) - } - return $ ftoc ( curline ) - } -proc ftoc_change { line { show show } } { + # dont need since work line + # argument , $ ftoc ( curline ) + # { $ ftoc ( curline ) == { } } { + # set ftoc ( curline ) [ mh_cur $ ftoc ( folder ) ] + # } + # { $ ftoc ( curline ) ! = { } } { + # $ exwin ( ftext ) tag remove cur $ ftoc ( curline ) .0 $ ftoc ( curline ) .end + # ftoc_rescanline $ ftoc ( curline ) + # } + # check 0 < $ line < last line error otherwise + $ exwin ( ftext ) tag remove cur $ line.0 $ line.end + ftoc_rescanlines [ list $ line ] + + # return $ ftoc ( curline ) + } + + # + # make newline currently selected line + # optionally clear oldline attribution + # +proc ftoc_change { newline { oldline { } } } { + global ftoc exwin - set ftoc ( curline ) $ line + + { ! [ info exists oldline ] || ( $ oldline== $ newline ) } { + set oldline { } + } + set ftoc ( curline ) $ newline { $ ftoc ( curline ) == { } } { set ok 0 } else { - { $ show == `` show '' } { $ exwin ( ftext ) tag remove unseen $ ftoc ( curline ) .0 $ ftoc ( curline ) .end + { $ oldline ! = { } } { + set ftoc ( pickone ) 1 + set ftoc ( lineset ) { } + $ exwin ( ftext ) tag remove cur $ oldline.0 $ oldline.end + ftoc_rescanlines [ list $ ftoc ( curline ) $ oldline ] + } else { + ftoc_rescanlines [ list $ ftoc ( curline ) ] } - ftoc_rescanline $ ftoc ( curline ) + $ exwin ( ftext ) tag add cur $ ftoc ( curline ) .0 $ ftoc ( curline ) .end set top [ $ exwin ( ftext ) index @ 0,4 ] [ catch { expr { $ top+1 } } ] { set top 0 } ; # trap 100.-1 format , iconic @ @ -695,7 +720,10 @ @ proc ftoc_markseen { ids } { } } } -proc ftoc_rescanline { ix { plus none } } { + # + # one used . kept reference + # +proc ftoc_rescanline_old { ix { plus none } } { global exmh exwin ftoc [ catch { set text [ $ exwin ( ftext ) get $ { ix } .0 $ { ix } .end ] @ @ -737,6 +765,57 @ @ proc ftoc_rescanline { ix { plus none } } exmh_error `` ftocrescanline $ ix : $ msg '' } } + + + # + # rescans set lines updates ftoc needed + # lines_in : list line numbers . ranges ( e.g . 200-210 ) allowed + # +proc ftoc_rescanlines { lines_in } { + global exmh exwin ftoc mhprofile + + exmh_debug ftoc_rescanlines [ time { + # sort lines weed duplicates . + # creep change folders + # set lastcandidate { } + # foreach newcandidate [ lsort -integer $ lines_in ] { + # { $ newcandidate ! = $ lastcandidate } { + # lappend lines $ newcandidate + # exmh_debug `` ** $ lines '' + # set lastcandidate $ newcandidate + # } + # } + # never mind dupechecking . potential checked + # ftoc_change takes time ( ~8 ms ) + set lines [ lsort -integer $ lines_in ] + + foreach line $ lines { + lappend msgnos [ ftoc_msgnumber $ line ] + } + set input [ open `` | $ mhprofile ( scan-proc ) \ + [ list + $ ftoc ( folder ) ] \ + [ join $ msgnos ] \ + -width $ ftoc ( scanwidth ) '' ] + set texts [ split [ string trim [ read $ input ] 
 ] 
 ] + catch { close $ input } + # exmh_debug `` * lines= $ lines
msgnos= $ msgnos
texts= $ texts '' + + set [ llength $ lines ] + { set 0 } { $ < $ } { incr } { + set line [ lindex $ lines $ ] + set tags [ $ exwin ( ftext ) tag names $ line.0 ] + $ exwin ( ftext ) configure -state normal + $ exwin ( ftext ) delete $ line.0 $ line.end + $ exwin ( ftext ) insert $ line.0 [ lindex $ texts $ ] + $ exwin ( ftext ) configure -state disabled + foreach tag $ tags { + $ exwin ( ftext ) tag add $ tag $ line.0 $ line.end + } + } + } + ] + } + proc ftoc_nextimplied { { show show } { implied implied } } { global ftoc { $ ftoc ( implied ) & & $ ftoc ( direction ) == `` prev '' } { @ @ -793,7 +872,7 @ @ proc ftoc_nextfolder { { implied } } { # last message , clear display # message moved deleted { $ ftoc ( curline ) ! = { } } { - ftoc_clearcurrent + ftoc_clearcurrent $ ftoc ( curline ) msg_clearcurrent } exmh_status `` '' @ @ -809,7 +888,7 @ @ proc ftoc_nextfolder { { implied } } { return } else { set ftoc ( softchange ) 1 - ftoc_clearcurrent + ftoc_clearcurrent $ ftoc ( curline ) msg_clearcurrent exmh_status `` '' exmh_status `` end folder ; < next > = > $ f '' warn @ @ -1113,7 +1192,7 @ @ proc ftoccommit { tagname commitproc { cop set ftoc ( displaydirty ) 1 ftoc_clearmsgcache { $ msgid == $ curid } { - ftoc_clearcurrent + ftoc_clearcurrent $ ftoc ( curline ) msg_clearcurrent } { $ l == $ ftoc ( curline ) } { index : lib/msg.tcl =================================================================== rcs file : /cvsroot/exmh/exmh/lib/msg.tcl , v retrieving revision 1.21 diff -u -b -b -w -p -r1.21 msg.tcl -- - lib/msg.tcl 22 jul 2002 21:23:48 -0000 1.21 +++ lib/msg.tcl 24 jul 2002 09:16:26 -0000 @ @ -73,10 +73,20 @ @ proc msg_showunseen { { show show } } { return 0 } proc msg_clearcurrent { } { - global msg exmh + global msg exmh ftoc + # cases true ? + { $ ftoc ( folder ) == $ exmh ( folder ) } { + set prevline [ ftoc_findmsg [ mh_cur $ ftoc ( folder ) ] ] + { $ prevline == { } } { + unset prevline + } + } set msg ( id ) { } ; # clear current message set msg ( dpy ) { } ; # currently displayed message mh_clearcur $ exmh ( folder ) + { [ info exists prevline ] } { + ftoc_clearcurrent $ prevline + } msgclear buttons_current 0 uri_clearcurrent @ @ -117,13 +127,13 @ @ proc msg_change { msgid { show show } } { exmh_debug msg_change [ time [ list msgchange $ msgid $ show ] ] } proc msgchange { msgid { show show } } { - global exmh exwin msg mhprofile + global exmh exwin msg mhprofile ftoc - ftoc_clearcurrent + set prevline [ ftoc_findmsg [ mh_cur $ ftoc ( folder ) ] ] mh_setcur $ exmh ( folder ) $ msgid ftoc_showsequences $ exmh ( folder ) set line [ ftoc_findmsg $ msgid ] - { ! [ ftoc_change $ line $ show ] } { + { ! [ ftoc_change $ line $ prevline ] } { exmh_status `` find msg $ msgid - rescan ? '' } else { { $ msg ( id ) == { } } { @ @ -652,14 +662,17 @ @ proc msg_uudecode { } { } proc msg_markunseen { } { - global exmh + global exmh ftoc msg_checkpoint ftoc_iterate line { set msgid [ ftoc_msgnumber $ line ] mh_markunseen $ exmh ( folder ) $ msgid } - msg_clearcurrent - ftoc_clearcurrent + ftoc_rescanlines $ ftoc ( lineset ) + # needed ? + # msg_clearcurrent + # needed anymore + # ftoc_clearcurrent flist_forgetunseen $ exmh ( folder ) ftoc_showsequences $ exmh ( folder ) } index : lib/scan.tcl =================================================================== rcs file : /cvsroot/exmh/exmh/lib/scan.tcl , v retrieving revision 1.21 diff -u -b -b -w -p -r1.21 scan.tcl -- - lib/scan.tcl 22 jul 2002 22:39:29 -0000 1.21 +++ lib/scan.tcl 24 jul 2002 09:16:26 -0000 @ @ -265,7 +265,7 @ @ proc scan_cacheupdate { } { # thing . # ! $ ftoc ( displayvalid ) { - set curline [ ftoc_clearcurrent ] ; # clear + + ftoc_clearcurrent $ ftoc ( curline ) ; # clear + [ file writable $ cachefile ] { set scancmd `` exec $ mhprofile ( scan-proc ) [ list + $ folder ] \ -width $ ftoc ( scanwidth ) > [ list $ cachefile ] '' @ @ -273,12 +273,12 @ @ proc scan_cacheupdate { } { exmh_status `` failed rescan folder $ folder : $ err '' warn } } - ftoc_change $ curline ; # restore + ftoc_change $ ftoc ( curline ) ; # restore } elseif [ catch { set cacheio [ open $ cachefile w ] - set curline [ ftoc_clearcurrent ] ; # clear + + ftoc_clearcurrent $ ftoc ( curline ) ; # clear + set display [ $ exwin ( ftext ) get 1.0 `` end -1 char '' ] - ftoc_change $ curline ; # restore + ftoc_change $ ftoc ( curline ) ; # restore puts $ cacheio $ display nonewline close $ cacheio set ftoc ( displaydirty ) 0
